import React from 'react';
import './Quotation.css';

const Quotation = ({visuPhrase}) => <div style={{"letterSpacing": 3, "fontFamily": "Courier"}}>{visuPhrase.charAt(0).toUpperCase() + visuPhrase.substring(1)}.</div>
export default Quotation
